type compare struct {
	value int
	count int
}

type compareList []compare

func (c compareList) Swap(i, j int) {
	c[i], c[j] = c[j],c[i]
}

func (c compareList) Len() int {
	return len(c)
}

func (c compareList) Less(i, j int) bool {
	return c[i].value > c[j].value
}

func hasGroupsSizeX(deck []int) bool {
	m := make(map[int]int)
	for _, value := range deck {
		if count, ok := m[value]; ok {
			m[value] = count + 1
		} else {
			m[value] = 1
		}
	}
	if len(m) < 1 {
		return false
	}
	//对map中value的大小进行排序，根据排序后的结果再循环处理
	s := compareList{}
	for value, count := range m {
		c := compare{value:value, count:count}
		s = append(s, c)
	}
	sort.Sort(s)
	flag := true
	baseValue := 0
	if len(m) == 1 {
		if s[0].count < 2 {
			return false
		} else {
			return true
		}
	}
	if len(m) > 1 && s[0].count < 2 {
		return false
	}
	for i := 2; i <= s[0].count && i <= s[1].count; i++ {
		if s[0].count % i == 0 && s[1].count % i == 0 {
			baseValue = i
			break
		}
	}
	if baseValue < 2 {
		return false
	}
	for _, item := range s {
		if item.count % baseValue != 0 {
			flag = false
			break
		}
	}
	return flag
}
